import React from 'react';
import '../App.css';
import api from '../api'

export class Cups extends React.Component {
    constructor(props){
        super(props);
        this.state = { products: []};
    }

    async componentDidMount(){
        await api.getAllProducts().then(products => {
            this.setState({
                products: products.data,
            })
        })
    }
    render() {
        this.state.products.map(product => {
            console.log(product);
        })
        return (
            <div>
                <h1></h1>
                {this.state.products.map((product, i) => {
                    <li key={i}>
                        {product.name}
                    </li>
                })}
            </div>
        )
    }
}

export default Cups;
